Pessoas, ontem (15/10), no fim de noite, um desespero tomou conta das redes sociais devido a pesquisa em que um estádio está marcado a posse de um chefe de quadrilha.
Teve quem desanimasse, quem aumentasse pressão, como tudo estivesse perdido.
Agora vamos pensar:
1) não temos o hábito de pesquisar e quando o fazemos é para desestimular;
2) essa facção travestida de partido gasta horrores com o Google para deixar o que eles querem por lá;
3) reserva, todos nós fazemos. Quando marcamos uma consulta médica, fazemos uma reserva com dia e hora marcado que pode ser cumprida ou remarcada por ambas as partes;
4) POSSE PRESIDENCIAL NUNCA FOI EM ESTÁDIO.

Essa última é a mais importante. Me citem um Presidente que tomou posse num estádio.
Isso tudo porque Bolsonaro lotou o Maracanazinho na Convenção do PL em julho.
Então, vamos IGNORAR o caso e continuar com nossas metas:
- trazer um indeciso;
- fazer propaganda dos feitos de nosso Presidente;
- se inscrever como FISCAL VOLUNTÁRIO
