General Villas Boas - O que podemos esperar de um governo de oposição?

O que podemos esperar de um governo de oposição?

- Desmantelamento das estruturas produtivas tão arduamente recuperadas, uma base capaz de se sustentar sem depender de governos;

- A volta do desemprego crescente, compensado por programas sociais demagógicos;

- A submissão ao globalismo com a consequente perda da identidade nacional;

- A destruição do civismo; A ridicularização do patriotismo e dos símbolos nacionais;

- A contaminação ideológica do ensino, impondo às crianças a aceitação de verdadeiras perversões;

- O retorno das fraudes profissionais, que os jovens terão conhecimento ao enfrentar o mercado de trabalho;

- A perda do valor da palavra e da vida;

- A substituição da verdade por narrativas;

- A perda de entusiasmo pelo uso de mentiras;

- A disfunção das Instituições; o desrespeito à Constituição;

- A relativização da soberania da Amazônia;

- Natureza acima das pessoas;

- Os índios como instrumentos de ONGs e Organismos Internacionais;

- Política externa pautada por simpatias ideológicas;

- Apoio às ditaduras;

- O desaparecimento do culto à honra, à pátria e à liberdade. A desesperança das pessoas que vestem o verde-amarelo.

General Villas Boas Outubro 2022.

